  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC INVESTMENT ADVISERS RELEASE 40-2635, AUGUST 16, 2007; ON AUGUST 7, 2007, A FINAL JUDGMENT WAS ENTERED BY CONSENT AGAINST RESPONDENT, PERMANENTLY ENJOINING HIM FROM FUTURE VIOLATIONS OF SECTION 17(A) OF THE SECURITIES ACT OF 1933 (\"SECURITIES ACT\") AND SECTION 10(B) OF THE SECURITIES EXCHANGE ACT OF 1934 (\"EXCHANGE ACT\") AND RULE 10B-5 THEREUNDER IN THE CIVIL ACTION NUMBER 07-C-0702. THE COMMISSION'S COMPLAINT ALLEGED THAT, ON APRIL 3, 2002, RESPONDENT RECEIVED NONPUBLIC INFORMATION ABOUT A JOINT BIO-EQUIVALENCE STUDY (THE \"BIO-EQUIVALENCE STUDY\") ON A DRUG THAT A COMPANY WAS DEVELOPING WITH ANOTHER COMPANY. SPECIFICALLY, RESPONDENT LEARNED FROM HIS BROTHER, WHO LED THE BIO-EQUIVALENCE STUDY, THAT THE STUDY WAS NOT GOING WELL. RESPONDENT PREVIOUSLY KNEW THE BIO-EQUIVALENCE STUDY WAS BEING CONDUCTED IN ORDER TO OBTAIN FOOD AND DRUG ADMINISTRATION APPROVAL OF A DRUG CRITICAL TO THE SHORT TERM SUCCESS OF ONE OF THE COMPANIES. BASED ON THIS INFORMATION, THE NEXT DAY RESPONDENT DIRECTED THE FUND THAT HE MANAGED TO AGGRESSIVELY SELL ALL OF ITS SHARES. THE FOLLOWING DAY, APRIL 5, 2002, THE COMPANIES ISSUED A PRESS RELEASE ANNOUNCING THAT THE BIO-EQUIVALENCE STUDY HAD BEEN UNSUCCESSFUL. THAT DAY, THE STOCK PRICE DECLINED 42 PERCENT. THE FUND AVOIDED A TOTAL OF $954,776 IN LOSSES BY SELLING ALL OF ITS SHARES THE DAY BEFORE THIS ANNOUNCEMENT.",
  "Resolution" : "Decision & Order of Offer of Settlement",
  "SanctionDetails" : [ {
    "Sanctions" : "Suspension"
  } ],
  "Sanction Details" : "WITHOUT ADMITTING OR DENYING THE FINDINGS, RESPONDENT CONSENTS TO THE ENTRY OF THIS ORDER INSTITUTING ADMINISTRATIVE PROCEEDINGS PURSUANT TO SECTION 203(F) OF THE INVESTMENT ADVISERS ACT OF 1940, MAKING FINDINGS, AND IMPOSING REMEDIAL SANCTIONS. ACCORDINGLY, IT IS HEREBY ORDERED THAT: RESPONDENT BE, AND HEREBY IS, SUSPENDED FROM ASSOCIATION WITH ANY INVESTMENT ADVISER FOR A PERIOD OF TWELVE MONTHS, EFFECTIVE ON THE SECOND MONDAY FOLLOWING THE ENTRY OF THIS ORDER. RESPONDENT SHALL PROVIDE TO THE COMMISSION, WITHIN 20 DAYS AFTER THE END OF THE TWELVE MONTH SUSPENSION PERIOD DESCRIBED ABOVE, AN AFFIDAVIT THAT HE HAS COMPLIED FULLY WITH THE SUSPENSION."
}

{
  "Initiated By" : "UNITED STATES SECURITIES AND EXCHANGE COMMISSION",
  "Allegations" : "SEC LITIGATION RELEASE NO. 20222, AUGUST 2, 2007: THE SECURITIES AND EXCHANGE COMMISSION FILED A COMPLAINT IN THE U.S. DISTRICT COURT FOR THE EASTERN DISTRICT OF WISCONSIN ON AUGUST 1, 2007 AGAINST JOSEPH A. FROHNA (\"JOE FROHNA\"). THE COMPLAINT ALLEGES THAT JOE FROHNA ENGAGED IN INSIDER TRADING BY CAUSING THE MUTUAL FUND THAT HE MANAGED TO SELL ALL OF ITS SHARES OF A COMPANY'S (THE \"COMPANY\") STOCK ON THE BASIS OF MATERIAL, NONPUBLIC INFORMATION THAT HE MISAPPROPRIATED FROM HIS BROTHER. THE SEC ALLEGES THAT JOE FROHNA'S INSIDER TRADING VIOLATED SECTION 17(A)(1), 17(A)(2) AND 17(A)(3) OF THE SECURITIES ACT OF 1933, SECTION 10(B) OF THE SECURITIES EXCHANGE ACT OF 1934 AND RULE 10B-5 PROMULGATED THEREUNDER. SPECIFICALLY, THE COMPLAINT ALLEGES THAT JOE FROHNA'S BROTHER, WITH WHOM JOE FROHNA HAD A RELATIONSHIP OF TRUST AND CONFIDENCE, WAS THE LEADER OF A BIO-EQUIVALENCE STUDY FOR A DRUG BEING DEVELOPED BY THE COMPANY (THE \"BIO-EQUIVALENCE STUDY\"). THE BIO-EQUIVALENCE STUDY WAS ONE OF THE KEYS TO THE COMPANY'S STOCK VALUE BECAUSE BIO-EQUIVALENCE NEEDED TO BE ESTABLISHED FOR FDA APPROVAL AND FOR THIS DRUG TO BE SOLD TO THE GENERAL PUBLIC. JOE FROHNA KNEW THIS INFORMATION. ON APRIL 3, 2002, JOE FROHNA'S BROTHER LEARNED THAT THE BIO-EQUIVALENCE STUDY WAS UNSUCCESSFUL. LATER THAT SAME DAY, JOE FROHNA CALLED HIS BROTHER AND LEARNED THAT THE BIO-EQUIVALENCY STUDY WAS UNSUCCESSFUL. THE NEXT MORNING, ON APRIL 4, 2002, JOE FROHNA CAUSED THE FUND HE MANAGED TO AGGRESSIVELY SELL ALL OF ITS 332,000 COMPANY SHARES. THE FOLLOWING DAY, APRIL 5, 2002, THE COMPANY PUBLICLY ANNOUNCED THAT THE BIO-EQUIVALENCE STUDY WAS UNSUCCESSFUL. THE PRICE OF THE COMPANY'S STOCK FELL 42% THAT DAY, FROM $7.63 PER SHARE TO A CLOSING PRICE OF $4.42 PER SHARE. AS A RESULT OF JOE FROHNA'S INSIDER TRADING, THE MICRO CAP FUND AVOIDED A LOSS OF $954,776.",
  "Resolution" : "Judgment Rendered",
