  "Sanction Details" : "ON AUGUST 7, 2007, A FINAL JUDGMENT WAS ENTERED AGAINST JOE FROHNA IN WHICH HE IS PERMANENTLY ENJOINED FROM FUTURE VIOLATIONS OF THE ANTIFRAUD PROVISIONS OF THE FEDERAL SECURITIES LAWS, AND HE IS ORDERED TO PAY DISGORGEMENT IN THE AMOUNT OF $954,776, PLUS PREJUDGMENT INTEREST IN THE AMOUNT OF $315,286.57, AND A CIVIL PENALTY IN THE AMOUNT OF $954,776.",
  "Broker Comment" : "ON AUGUST 1, 2007, THE SEC FILED A COMPLAINT AGAINST JOSEPH FROHNA IN THE U.S. DISTRICT COURT FOR THE EASTERN DISTRICT OF WISCONSIN, CASE NO. 07-CV-702(E.D. WIS. 2007). THE COMPLAINT ALLEGED THAT MR. FROHNA, WHO NEITHER ADMITS NOR DENIES THE ALLEGATIONS, VIOLATED SECTION 17(A) OF THE SECURITIES ACT OF 1933 AND SECTION 10(B) OF THE SECURITIES EXCHANGE ACT OF 1934 AND RULE 10B-5 THEREUNDER BY MISAPPROPRIATING MATERIAL, NON-PUBLIC INFORMATION, DURING 2002 REGARDING A DRUG BEING DEVELOPED BY XOMA LTD. AND GENENTECH INC. AND USING THAT INFORMATION AS A BASIS TO SELL THE SHARES OF XOMA OWNED BY THE MUTUAL FUND HE MANAGED AT U.S. BANCORP ASSET MANAGEMENT. THE MUTUAL FUND AVOIDED A LOSS OF $954,776.  MR. FROHNA AGREED TO A SETTLEMENT WITH THE SEC THAT WAS ENTERED BY THE COURT AS A FINAL JUDGMENT ON AUGUST 7, 2007 (SEC. V JOSEPH A. FROHNA, CASE NO. 07-CV-702, FINAL JUDGMENT, DOCKET NO. 4 (E.D. WIS. AUG. 7, 2007). IN THE SETTLEMENT, MR. FROHNA CONSENTED TO PAY DISGORGEMENT OF $954,776, EQUAL TO THE LOSS AVOIDED BY THE FUND, PREJUDGMENT INTEREST IN THE AMOUNT OF $315,286.57, AND A CIVIL PENALTY OF $954,776.  HE ALSO CONSENTED TO THE ENTRY OF AN INJUNCTION BARRING HIM FROM FUTURE VIOLATIONS OF SECTION 17(A), SECTION 10(B) OR RULE 10B-5."
}

